import React from 'react'


function BannerCont() {
  return (
    <section id="bannerType" className="banner__wrap section gmarket">
        {bannerText.map((txt)=>(
            <BannerInfo
            key={txt.title}
            title ={txt.title}
            desc={txt.desc}
            address={txt.address}
            />
        ))}
    </section>
  )
}

export default BannerCont
